    <style>
      .gb-info-btn {
        position: fixed;
        left: 16px;
        bottom: 16px;
        width: 44px;
        height: 44px;
        border-radius: 50%;
        background: #ffffff;
        border: 1px solid #999;
        box-shadow: 0 2px 6px rgba(0,0,0,0.25);
        z-index: 1201;
        display: flex;
        align-items: center;
        justify-content: center;
        font: 700 18px/1 system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, sans-serif;
        cursor: pointer;
        user-select: none;
      }
      .gb-info-btn:focus { outline: 2px solid #2c7fb8; }

      .gb-info-panel {
        position: fixed;
        left: 16px;     /* align with the button */
        bottom: 70px;   /* raise above button */
        z-index: 1200;
        background: rgba(255,255,255,0.98);
        border: 1px solid #999;
        border-radius: 10px;
        box-shadow: 0 2px 6px rgba(0,0,0,0.3);
        padding: 12px;
        width: min(92vw, 360px);
        max-height: 70vh;
        display: none;
      }
      .gb-info-header {
        display: grid;
        grid-template-columns: auto 1fr;
        grid-gap: 12px;
        align-items: center;
      }
      .gb-info-title {
        font-weight: 700;
        font-size: 16px;
        margin: 0;
      }
      .gb-info-meta {
        font-size: 13px;
        margin-top: 2px;
      }
      .gb-info-row {
        margin-top: 6px;
        display: flex;
        align-items: center;
        gap: 12px;
        font-size: 12px;
      }
      .gb-info-close {
        position: absolute;
        right: 8px;
        top: 6px;
        border: none;
        background: transparent;
        font-size: 18px;
        cursor: pointer;
        line-height: 1;
      }
      .gb-info-close:focus { outline: 2px solid #2c7fb8; }

      @media (max-width: 480px) {
        .gb-info-panel { width: 92vw; }
        .gb-info-title { font-size: 15px; }
        .gb-info-meta { font-size: 12px; }
        .gb-info-row { font-size: 11px; }
      }
    </style>

    <script>
      (function() {
        var btn = document.getElementById('gbInfoBtn');
        var panel = document.getElementById('gbInfoPanel');
        var closeBtn = document.getElementById('gbInfoClose');

        function openPanel() {
          panel.style.display = 'block';
          btn.setAttribute('aria-expanded', 'true');
          panel.setAttribute('aria-hidden', 'false');
        }
        function closePanel() {
          panel.style.display = 'none';
          btn.setAttribute('aria-expanded', 'false');
          panel.setAttribute('aria-hidden', 'true');
        }

        btn.addEventListener('click', function(e) {
          if (panel.style.display === 'block') {
            closePanel();
          } else {
            openPanel();
          }
        });
        closeBtn.addEventListener('click', function(e) {
          closePanel();
        });

        // Close panel when clicking outside it
        document.addEventListener('click', function(e) {
          if (!panel.contains(e.target) && e.target !== btn) {
            closePanel();
          }
        });
      })();
    </script>
    
    
    <script>
    (function() {
      var speciesSet = new Set(['American Tree Sparrow', 'Clay-colored Sparrow', 'Northern Waterthrush', 'Ruby-throated Hummingbird', 'Veery', 'Western Tanager']);
      function clearSpecies() {
        var root = document.querySelector('.leaflet-control-layers-overlays');
        if (!root) return;
        var labels = root.querySelectorAll('label');
        labels.forEach(function(label){
          var input = label.querySelector('input[type=checkbox]');
          if(!input) return;
          var name = label.textContent.trim();
          if (speciesSet.has(name) && input.checked) {
            input.click();
          }
        });
      }
      var ClearCtl = L.Control.extend({
        onAdd: function(map) {
          var div = L.DomUtil.create('div', 'leaflet-bar');
          div.style.background = 'white';
          div.style.padding = '4px 6px';
          div.style.cursor = 'pointer';
          div.style.font = '12px/1.2 sans-serif';
          div.style.boxShadow = '0 1px 4px rgba(0,0,0,0.2)';
          div.title = 'Uncheck all species layers';
          div.innerHTML = 'Clear species';
          L.DomEvent.on(div, 'click', function(e) {
            L.DomEvent.stop(e);
            clearSpecies();
          });
          return div;
        },
        onRemove: function(map) {}
      });
      function addWhenReady() {
        if (!document.querySelector('.leaflet-control-layers')) {
          return setTimeout(addWhenReady, 150);
        }
        (new ClearCtl({ position: 'topright' })).addTo(map_60b9306b92c2f2ef02e7c8c35f3c8a23);
      }
      addWhenReady();
    })();
    </script>
